import { CREATE_POSTS } from '../Actions/types';

const initialState = {
    items: [],
    item: {}
}

export default function (state = initialState, action) {
    switch (action.type) {
        case CREATE_POSTS:
            return {
                ...state,
                item: action.payload
            };
        default:
            return state;
    }
}
